void
of_hello_elem_wire_object_id_get(of_object_t *obj, of_object_id_t *id)
{
    unsigned char *buf = OF_OBJECT_BUFFER_INDEX(obj, 0);
    switch (obj->version) {
    case OF_VERSION_1_3: {
        uint16_t value = U16_NTOH(*(uint16_t *)(buf + 0)); /* type */
        switch (value) {
        case 0x1:
            *id = OF_HELLO_ELEM_VERSIONBITMAP;
            break;
        default:
            *id = OF_HELLO_ELEM;
            break;
        }
        break;
    }
    case OF_VERSION_1_4: {
        uint16_t value = U16_NTOH(*(uint16_t *)(buf + 0)); /* type */
        switch (value) {
        case 0x1:
            *id = OF_HELLO_ELEM_VERSIONBITMAP;
            break;
        default:
            *id = OF_HELLO_ELEM;
            break;
        }
        break;
    }
    default:
        LOCI_ASSERT(0);
    }
}


